import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './VideoPage.css';

const VideoPage = () => {
    const [videos, setVideos] = useState([]);
    const [hoveredVideo, setHoveredVideo] = useState(null);
    const [likes, setLikes] = useState({});
    const [dislikes, setDislikes] = useState({});
    const [newVideo, setNewVideo] = useState({ title: '', category: '', date: '2024-09-28' }); // Добавляем новое видео

    // Функция для получения данных с сервера
    const fetchVideos = async () => {
        try {
            const response = await axios.get('http://localhost:8000/api/videos/');
            setVideos(response.data);
        } catch (error) {
            console.error('Ошибка при получении данных:', error);
        }
    };

    useEffect(() => {
        fetchVideos();
    }, []);

    const handleLike = (id) => {
        setLikes(prevLikes => ({
            ...prevLikes,
            [id]: prevLikes[id] ? false : true
        }));
        setDislikes(prevDislikes => ({
            ...prevDislikes,
            [id]: false
        }));
    };

    const handleDislike = (id) => {
        setDislikes(prevDislikes => ({
            ...prevDislikes,
            [id]: prevDislikes[id] ? false : true
        }));
        setLikes(prevLikes => ({
            ...prevLikes,
            [id]: false
        }));
    };

    // Функция для отправки нового видео на сервер
    const handleAddVideo = async () => {
        try {
            const response = await axios.post('http://localhost:8000/api/videos/', newVideo);
            setVideos([...videos, response.data]); // Добавляем новое видео в состояние
            setNewVideo({ title: '', category: '', date: '2024-09-28' }); // Сбрасываем форму
        } catch (error) {
            console.error('Ошибка при отправке данных:', error);
        }
    };

    return (
        <div className="video-page">
            <div className="video-list">
                {videos.map((video) => (
                    <div
                        className="video-item"
                        key={video.id}
                        onMouseEnter={() => setHoveredVideo(video)}
                        onMouseLeave={() => setHoveredVideo(null)}
                    >
                        <div className="video-title">{video.title}</div>
                        <div className="video-controls">
                            <button className={`reaction-btn ${likes[video.id] ? 'active' : ''}`} onClick={() => handleLike(video.id)}>
                                •ᴗ•
                            </button>
                            <button className={`reaction-btn ${dislikes[video.id] ? 'noactive' : ''}`} onClick={() => handleDislike(video.id)}>
                                ˙◠˙
                            </button>
                        </div>
                        {hoveredVideo && hoveredVideo.id === video.id && (
                            <div className="tooltip">
                                <div className="video-category">
                                    <strong>Категория:</strong> {video.category}
                                </div>
                            </div>
                        )}
                        <div className="current-date">{newVideo.date}</div>
                    </div>
                ))}
            </div>
            <div className="add-video">
                <h3>Добавить новое видео</h3>
                <input
                    type="text"
                    placeholder="Название видео"
                    value={newVideo.title}
                    onChange={(e) => setNewVideo({ ...newVideo, title: e.target.value })}
                />
                <input
                    type="text"
                    placeholder="Категория"
                    value={newVideo.category}
                    onChange={(e) => setNewVideo({ ...newVideo, category: e.target.value })}
                />
                <button onClick={handleAddVideo}>Добавить</button>
            </div>
            <div className="refresh-recommendations">
                <button className="refresh-btn" onClick={fetchVideos}>��бновить рекомендации</button>
            </div>
        </div>
    );
};

export default VideoPage;
